import React from 'react';
import './App.css';
import Facebook from './components/Icons/Facebook/Facebook';
import Instagram from './components/Icons/Instagram/Instagram';
import Twitter from './components/Icons/Twitter/Twitter';
import Flyer from './components/Flyer/Flyer';
import Logo from './components/Logo/Logo';
import {Row, Col} from 'react-bootstrap'
import Statement from './components/Statement/Statement'
import Statement2 from './components/Statement/Statement2'


function App() {

  return (

    <div className="App">

      <header className="App-header">
      <Row>
        <div><Logo/></div>
        <hr/>
        </Row>
        <Row>
        <Col md="auto">
        <div className="container">
          <Flyer/>

        </div>  

        </Col>
</Row>
<Row>
        <Col md="6" style={{color:"black"}}>

        <div className="card">
         <Statement/>
         <br></br>
         <Statement2/>
        </div>
      </Col>
     </Row>
         <div className="container">
        <Instagram/><Facebook/><Twitter/>
        </div>
      </header>
    </div>

  );
}

export default App;
